CREATE DEFINER=`root`@`localhost` PROCEDURE `add_to_cart`(userId varchar(32), product bigint, amount int)
begin
    if exists(
		select * from ShoppingCart
        where ShoppingCart.userID=userId and ShoppingCart.productID=product
	) 
    then
		update ShoppingCart 
        set ShoppingCart.quantity=ShoppingCart.quantity+amount
        where ShoppingCart.userID=userId and ShoppingCart.productID=product;
	else 
		insert into ShoppingCart values (
			userId, product, amount
        );
	end if;
	end ;;
DELIMITER ;
