CREATE DEFINER=`root`@`localhost` PROCEDURE `get_cart_amount`(in fname varchar(25), out amount int)
begin
    set @userId = (
		select Users.userID from Users 
        inner join Names on Users.nameID=Names.nameID
        where Names.firstName=fname
	);
    select sum(quantity) 
    into amount
    from ShoppingCart
    where ShoppingCart.userID=@userId;
	end ;;
DELIMITER ;
